import React from "react";
import Theme from "../Theme";
import { MuiThemeProvider } from "@material-ui/core/styles";
import NavBar from "../Navbar";

function App() {
  return (
    <MuiThemeProvider theme={Theme}>
      <div className="App">
        <NavBar />
      </div>
    </MuiThemeProvider>
  );
}

export default App;
